import React from "react"
import styled from "styled-components"

const Header = styled.header`
	background: #273456;
	padding: 5px; 3%;

	h1 {
		text-transform: uppercase;
		color: #fff;
		font-weight: 100;
	}
`

const HeaderComponent = () => {
	return (
		<Header>
			<h1>
				Books<span>OnTap</span>
			</h1>
		</Header>
	)
}

export default HeaderComponent
